import React from "react";
import { Drawer, Row, Col, Input, InputNumber, Select, Button } from "antd";
const { Option } = Select;
const Drawers = ({ visible, onClose, value }) => {
  return (
    <Drawer
      title="Basic Drawer"
      closable={false}
      placement="right"
      onClose={onClose}
      visible={visible}
    ></Drawer>
  );
};

export default Drawers;
